BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "trangbi" (
	"id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"image"	BLOB,
	"tentrangbi"	TEXT,
	"thuoctinh"	TEXT,
	"chitiet"	TEXT,
	"Field6"	TEXT,
	"matb"	INTEGER,
	"loaitb"	INTEGER
);
INSERT INTO "trangbi" VALUES (1,X'','Băng Cầu','Công Phép','+50 Công Phép +450 Máu +300 Năng Lượng +10% Hồi Chiêu','NỘI TẠI DUY NHÂT: Kỹ năng sát thương sẽ khiến kẻ địch hứng chịu thêm hiệu quả bị giảm 20% Tốc Chạy, duy trì 1.5s',1,1);
INSERT INTO "trangbi" VALUES (2,X'','Gậy Đầu Lâu','Công Phép','+80 Công Phép +10% Hồi chiêu','NỘI TẠI DUY NHẤT: Giảm 35% kháng phép của toàn bộ kẻ định trong phạm vi 2000 xung quanh.',2,1);
INSERT INTO "trangbi" VALUES (3,X'','Giáp Ngọc','Công Phép','+50 Công phép +300 Năng lượng  +100% Hồi năng lượng','NỘI TẠI DUY NHẤT-Cường Hóa Hút Phép: + 20% Hút máu phép (Lợi ích hút máu từ sát thương nhóm chỉ có 40%) .
NỘI TẠI DUY NHẤT: Khi bị tấn công bằng đòn đánh thường từ tướng địch, sẽ hồi 15% năng lượng trên sát thương. Hạ tướng địch hồi 40% năng lượng tối đa, khi hỗ trợ hồi 25% năng lượng tối đa.',3,1);
INSERT INTO "trangbi" VALUES (4,X'','La Bàn Cổ','Công Phép','+50 Công phép +300 Máu +300 Năng lượng +30 Giáp','NỘI TẠI DUY NHẤT: Tướng mỗi phút + 50 Năng lượng, + 5 Công phép (Tối đa +300 Năng lượng, +30 Công phép).',4,1);
INSERT INTO "trangbi" VALUES (5,X'','Mũ Pháp Sư','Công Phép','+60 Công phép +250 Năng lượng','NỘI TẠI DUY NHẤT: Tăng Công phép bằng 3% năng lượng tối đa. NỘI TẠI DUY NHẤT: Trong mỗi lần triển khai kỹ năng, năng lượng tối đa tăng 15 điểm, mức cộng thêm năng lượng cao nhất là 750.',5,1);
INSERT INTO "trangbi" VALUES (6,X'','Mũ Tử Thần','Công Phép','+120 Công phép','NỘI TẠI DUY NHẤT: Công phép tăng 30%',6,1);
INSERT INTO "trangbi" VALUES (7,X'','Nhẫn Vô Cực','Công Phép','+80 Công phép +50 Tốc đánh +10% Hồi chiêu','NỘI TẠI DUY NHẤT: Đòn đánh thường trong mỗi lần sẽ kèm theo (25+20% Công phép) sát thương phép',7,1);
INSERT INTO "trangbi" VALUES (8,X'','Phong Linh','Công Phép','+50 Công phép +250 Máu +300 Năng lượng +10% Hồi chiêu','KÍCH HOẠT DUY NHẤT: Lướt lên 500 khoảng cách (Không tiêu hao phép, hồi chiêu 5s). NỘI TẠI DUY NHẤT: Sử dụng kỹ năng gây sát thương phép cho địch nhận hiệu ứng Phong linh, tăng 10% tốc chạy bản thân trong 3s.',8,1);
INSERT INTO "trangbi" VALUES (9,X'','Sách Quỷ','Công Phép','+50 Công phép +20% Hồi chiêu ','NỘI TẠI DUY NHẤT-Công Kích: Sau khi triển khai kỹ năng, đòn đánh thường tiếp theo sẽ kèm theo (75+50% Công phép) sát thương phép, thời gian hồi 3s.',9,1);
INSERT INTO "trangbi" VALUES (10,X'','Tro Tàn','Công Phép','+80 Công phép +250 Máu +10% Hồi chiêu','NỘI TẠI DUY NHẤT: +10 xuyên kháng phép. NỘI TẠI DUY NHẤT: Sử dụng kỹ năng gây sát thương phép sẽ thiêu đốt địch, mỗi giây gây sát tương phép (10 + 3% máu hiện tại) kéo dài 3s.',10,1);
INSERT INTO "trangbi" VALUES (11,X'','Trượng Phòng Hộ','Công Phép','+80 Công phép +50 Giáp','KÍCH HOẠT DUY NHẤT: Không thể nhấn chọn tướng trong 3s, miễn dịch sát thương và hiệu quả phép bất kỳ, nhưng bản thân cũng không thể di chuyển, tấn công, thi triển phép hoặc dùng kỹ năng (Không cần năng lượng, thời gian hồi 60s)',11,1);
COMMIT;
